import React from 'react';
import './LoginPage.css';

class LoginPage extends React.Component{
  constructor(props) {
    super(props);

    this.state = {
      loginOption: "login"
    }
  }

  render() {
    return (
      <div id="login-page">
        <div class="login-container">
          <form class="login">
            <h1>Hello</h1>
          </form>
          <form class="signup hide">
            <h1>Hello1</h1>
          </form>
          <form class="guest hide">
            <h1>Hello2</h1>
          </form>
          <div class="login-options">
            <div class="login-btn">
              <h1>Login</h1>
            </div>
            <div class="signup-btn">
              <h1>Sign Up</h1>
            </div>
            <div class="guest-btn">
            <h1>Login</h1>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default LoginPage;
